import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import React from 'react'
import Home from "./Home";

export const App = () => {
    return (
        <>
        <Router>
            <Switch>
                <Route exact path="/login">
                    <Login/>
                </Route>
                <Route exact path ="/">
                    <Home/>
                </Route>

            </Switch>
        </Router>
        </>
    )
}
